import React from 'react'
import {
    useParams,
    useRouteMatch,
    Switch,
    Route
} from 'react-router-dom';

function Home() {
    let { path, url } = useRouteMatch();

    return (
        <Switch>
            <Route exact path={path}>
                <h3>Please select a topic.</h3>
            </Route>
            <Route path={`${path}/:topicId`}>
                <Topic />
            </Route>
        </Switch>
    )
}

export default Home
